  return (
    <div className="">
      <div className="mt-5">
        <Container>
          <div class="row">
            <div class="col-lg-3">
              <Image className="icon_phone" src="images/icon_phone.jpg"></Image>
            </div>
            <div class="col-lg-3">              <Image className="icon_phone" src="images/icon_phone.jpg"></Image></div>
            <div class="col-lg-3">aaaaaaaa</div>
            <div class="col-lg-3">aaaaaaaa</div>
          </div>
        </Container>
      </div>
    </div>
  );
};

export default Homepage;
